import React from 'react'
import './css/buttons.css'



const Button2 = () =>{
  return (
    <div className='Offices'>
        <button2>
            Offices
        </button2>
    </div>
  )
}
const Button3 = () =>{
  return (
    <div className='People'>
        <button3>
            People
        </button3>
    </div>
  )
}

const Button4 = () =>{
  return (
    <div className='Jobs'>
        <button4>
            Jobs
        </button4>
    </div>
  )
}
const Button5 = () =>{
  return (
    <div className='Directory'>
        <button5>
            Directories
        </button5>
    </div>
  )
}
  const Button6 = () =>{
    return (
      <div className='AboutMKE'>
          <button6>
              AboutMKE
          </button6>
      </div>
    )
  }
    const Button7 = () =>{
      return (
        <div className='NewsEvents'>
            <button7>
                News/Events
            </button7>
        </div>
      )
}
export{
    
    Button2,
    Button3,
    Button4,
    Button5,
    Button6,
    Button7
}
